import axios from "axios"

import './App.css';

function App() {
  const [product, setProduct]=useState([])
  const [isModalOpen, setIsModalOpen]=useState(false)
  const openPopup=()=>{
    setIsModalOpen(true)
}
  const handleClose=()=>{
  setIsModalOpen(false)
}

  const getAllProduct=()=>{
  axios.get("http://localhost:3005/product").then((res)=>{
  setProduct(res.data)
  })
}

  useEffect(()=>{
  getAllProduct()
},[])
  return (
    <>
    <div className="std-container">
      <h3>TEST HEADER</h3>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {product &&
            product.map((item) => (
              <tr key={item.id}>
                <td>{item.name}</td>
                <td>{item.price}</td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  </>
  );
};


export default App;
